define(['pdfmake', 'vfsfonts'], function (pdfmake) {
    function createPDF(inputData, action,reportTitle,pageStyle) {
       
        var title = {
            text: reportTitle,
            style: 'header'
        };
        var image = {
            image:'data:image/png;base64,',
        
            width: 100,
            height: 40,
            alignment: 'center',
            margin: [0, 25, 25, 0]
        };

        var styles = {
            header: {
                fontSize: 18,
                bold: true,
                margin: [0, 0, 0, 10],
                alignment: 'center'
            },
            tableHeader: {
                bold: true,
                fontSize: 13,
                color: 'black',
                bgcolor: "#FF0000",
                fillColor: '#eeeeee'
            }
        };

        var document = {
            pageSize: pageStyle.size,
            pageOrientation: pageStyle.orientation,
           // background: image,
            content: [
                {
            image:'data:image/png;base64,',
        
                },
                title,
                
                {text: '', fontSize: 14, bold: true, margin: [0, 20, 0, 8]},
                {
                    style: 'tableExample',
                    table: {
                        headerRows: 1,
                        body:
                                inputData
                    },
                    layout: {
                        hLineWidth: function (i, node) {
                            return (i === 0 || i === node.table.body.length) ? 1 : 1;
                        },
                        vLineWidth: function (i, node) {
                            return (i === 0 || i === node.table.widths.length) ? 1 : 1;
                        },
                        hLineColor: function (i, node) {
                            return (i === 0 || i === node.table.body.length) ? 'black' : 'black';
                        },
                        vLineColor: function (i, node) {
                            return (i === 0 || i === node.table.widths.length) ? 'black' : 'black';
                        },
                                alignment: 'right', // Optional, for body texts
                                width: 'auto' // Changes width of the table
                        // paddingLeft: function(i, node) { return 4; },
                        // paddingRight: function(i, node) { return 4; },
                        // paddingTop: function(i, node) { return 2; },
                        // paddingBottom: function(i, node) { return 2; },
                        // fillColor: function (i, node) { return null; }
                    }
                }
            ],
            styles: styles
        };

        var pdf = pdfmake.createPdf(document);
        console.log(action);
        if (action == 'download')
            pdf.download(reportTitle);
        else if (action == 'print')
            pdf.print();
        else
            pdf.open();
    }
    return {
        fromUser: createPDF
    };
});
